import './contactStyel.css';

const Contact = () => (
    <div id='home' className='containerContact'>
        <div className='wrapContact'>
            <p className='text'>
                Aquí podrás<span className='name'>Contactarme.</span> <br/>
            </p>

        </div>
    </div>
)

export default Contact
